import React from 'react';

const Feedback = ({ text, author, photo }) => {
  return (
    <div className='flex'>
      <img src={photo} alt="Feedback" />
      <p>{text}</p>
      <p>- {author}</p>
    </div>
  );
};

export default Feedback;
